import React, { useCallback } from 'react';
import Particles from 'react-tsparticles';
import { loadFull } from 'tsparticles';

function App() {
  const particlesInit = useCallback(async (engine) => {
    await loadFull(engine);
  }, []);

  return (
    <div className="App">
      <Particles
        id="tsparticles"
        init={particlesInit}
        options={{
          preset: 'stars',
          background: {
            color: '#000',
          },
          particles: {
            color: {
              value: '#fff',
            },
            move: {
              direction: 'none',
              enable: true,
              outModes: 'out',
              speed: 0.5,
            },
            number: {
              value: 100,
            },
            opacity: {
              value: 1,
            },
            shape: {
              type: 'circle',
            },
            size: {
              value: { min: 1, max: 3 },
            },
          },
        }}
      />
      {/* Your other components go here */}
    </div>
  );
}

export default App;
